import { createReducer, on } from '@ngrx/store';
import { removeError, setLoginError, setRegisterError, setToken } from './auth.actions';
export const initialState = {
  token: "",
  error: null
};
export const authReducer = createReducer(initialState, on(setToken, (state, {
  token
}) => {
  return Object.assign(Object.assign({}, state), {
    token
  });
}), on(setLoginError, (state, {
  error
}) => {
  return Object.assign(Object.assign({}, state), {
    error
  });
}), on(setRegisterError, (state, {
  error
}) => {
  return Object.assign(Object.assign({}, state), {
    error
  });
}), on(removeError, (state, {
  error
}) => {
  return Object.assign(Object.assign({}, state), {
    error
  });
}));
